import React from 'react';

const Footer = () => {
    return (
        <footer style={{ backgroundColor: '#222', color: 'white', padding: '20px 0' }}>
            <div
                style={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    flexWrap: 'wrap',
                    maxWidth: '1200px',
                    margin: '0 auto',
                    padding: '0 20px',
                }}
            >
                {/* Sección de Información */}
                <div style={{ flex: '1', marginBottom: '20px' }}>
                    <h3 style={{ marginBottom: '10px' }}>Contacto</h3>
                    <p style={{ margin: '5px 0' }}>Teléfono: +56 9 1234 5678</p>
                    <p style={{ margin: '5px 0' }}>Email: info@hostalejemplo.com</p>
                </div>

                {/* Sección de Enlaces */}
                <div style={{ flex: '1', marginBottom: '20px', textAlign: 'center' }}>
                    <h3 style={{ marginBottom: '10px' }}>Enlaces Rápidos</h3>
                    <ul style={{ listStyle: 'none', padding: 0 }}>
                        <li><a href="/" style={linkStyle}>Inicio</a></li>
                        <li><a href="/nosotros" style={linkStyle}>Nosotros</a></li>
                        <li><a href="/galeria" style={linkStyle}>Galería</a></li>
                    </ul>
                </div>

                {/* Sección de Redes Sociales */}
                <div style={{ flex: '1', marginBottom: '20px', textAlign: 'right' }}>
                    <h3 style={{ marginBottom: '10px' }}>Síguenos</h3>
                    <p>
                        <a href="#" style={linkStyle}>Facebook</a> |{' '}
                        <a href="#" style={linkStyle}>Instagram</a> |{' '}
                        <a href="#" style={linkStyle}>Twitter</a>
                    </p>
                </div>
            </div>

            {/* Derechos reservados */}
            <div style={{ textAlign: 'center', paddingTop: '10px', borderTop: '1px solid #444' }}>
                <p style={{ margin: 0, fontSize: '14px', color: '#aaa' }}>
                    © {new Date().getFullYear()} Hostal Ejemplo. Todos los derechos reservados.
                </p>
            </div>
        </footer>
    );
};

// Estilo de los enlaces
const linkStyle = {
    color: '#00bfff',
    textDecoration: 'none',
    transition: 'color 0.3s ease',
};

linkStyle[':hover'] = { color: '#0056b3' };

export default Footer;
